        "description": "Documental basado en el libro homónimno del autor Jacques Grimault. Durante siglos las grandes pirámides han fascinado a la humanidad. En ‘La Revelación de las Pirámides’, el director Patrice Pooyard, nos revela lo que hay detrás de los más grandes misterios arqueológicos: Tal vez un mensaje de suma importancia para toda la humanidad. Desde China hasta Perú, desde Egipto a México, a través de los sitios más enigmáticos y bellos del mundo, el director ha pasado 6 años investigando con eminentes especialistas científicos para verificar sus descubrimientos. El resultado sacudirá las enseñanzas de la historia en su verdadera esencia, y revolucionará por completo la egiptología. Una gran odisea a lo largo de un recorrido con un impresionante clímax y una revelación tan inesperada como asombrosa.\n\nAño : 2010\nPaís : Francia\nDirector : Patrice Pooyard\nGuión : Patrice Pooyard, Jacques Grimault, Olivier Krasker-Rosen (Libro: Jacques Grimault)\nMúsica : Jean-Baptiste Sabiani\nFotografía : Martial Barrault, Valentin Caron, Julien Guitard, Vincent Mathias, Jean-Pierre Vial\nReparto : Documentary, Brian Cox\nProductora : Ekwanim Productions / Kerguelen Productions / Gérard Fournerie\nGénero : Documental | Antiguo Egipto\n\n- French version https://www.youtube.com/watch?v=HFpHDXUgcqw\n- English version https://www.youtube.com/watch?v=2fS9ixfQ_no\n- Secrets of The Egyptian Pyramids HD -\n\nFollow us on social media :\nFacebook : https://www.facebook.com/BestDocumentaryTV",
